import{_ as a,c as t,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const R=JSON.parse('{"title":"DROP TEXT SEARCH PARSER","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_PARSER.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_PARSER.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_PARSER.md"};function r(n,e,d,p,l,c){return s(),t("div",null,e[0]||(e[0]=[o('<h1 id="drop-text-search-parser" tabindex="-1">DROP TEXT SEARCH PARSER <a class="header-anchor" href="#drop-text-search-parser" aria-label="Permalink to &quot;DROP TEXT SEARCH PARSER&quot;">​</a></h1><h2 id="description" tabindex="-1"><a id="Description"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;Description&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p>Removes a text search parser.</p><h2 id="synopsis" tabindex="-1"><a id="Synopsis"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;Synopsis&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TEXT SEARCH PARSER [ IF EXISTS ] &lt;name&gt; [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description-1" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description-1" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP TEXT SEARCH PARSER</code> drops an existing text search parser. You must be a superuser to use this command.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the text search parser does not exist. WarehousePG issues a notice in this case.</p><p>name : The name (optionally schema-qualified) of an existing text search parser.</p><p>CASCADE : Automatically drop objects that depend on the text search parser, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the text search parser if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="Examples"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;Examples&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the text search parser <code>my_parser</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TEXT SEARCH PARSER my_parser;</span></span></code></pre></div><p>This command will not succeed if there are any existing text search configurations that use the parser. Add <code>CASCADE</code> to drop such configurations along with the parser.</p><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>DROP TEXT SEARCH PARSER</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_TEXT_SEARCH_PARSER.html">ALTER TEXT SEARCH PARSER</a>, <a href="./CREATE_TEXT_SEARCH_PARSER.html">CREATE TEXT SEARCH PARSER</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',21)]))}const u=a(i,[["render",r]]);export{R as __pageData,u as default};
